'use client';
import { Circle } from './Circle/Circle.js';
import { Rectangle } from './Rectangle/Rectangle.js';
import { Text } from './Text/Text.js';

const Skeleton = {
    Circle: Circle,
    Rectangle: Rectangle,
    Text: Text,
};
Skeleton.Circle.displayName = 'Skeleton.Circle';
Skeleton.Rectangle.displayName = 'Skeleton.Rectangle';
Skeleton.Text.displayName = 'Skeleton.Text';

export { Skeleton, Circle as SkeletonCircle, Rectangle as SkeletonRectangle, Text as SkeletonText };
